A list of glob patterns to match against a plugin's contents. The first pattern that matches any files will be used by default as a plugin's use field. This defaults to match = [ "{{ name }}.plugin.zsh", "{{ name }}.zsh", "{{ name }}.sh", "{{ name }}.zsh-theme", "*.plugin.zsh", "*.zsh", "*.sh", "*.zsh-theme"
] If the shell is Bash then this defaults to match = [ "{{ name }}.plugin.bash", "{{ name }}.plugin.sh", "{{ name }}.bash", "{{ name }}.sh", "*.plugin.bash", "*.plugin.sh", "*.bash", "*.sh"
] If the shell is Fish then this defaults to match = [ "conf.d/{{ name }}.fish", "conf.d/{!_*,*}.fish", "{completions,functions}/{{ name }}.fish", "{completions,functions}/{!_*,*}.fish", "{completions,functions}/*.fish", "{{ name }}.fish", "{!_*,*}.fish", "*.fish"
]
